import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';

function Footer() {
  return (
    <div>
        <div className='row'>
            <div className='col-6'>
                <img src='favicon.png' style={{height:''}} />
            </div>
            <div className='col-6'>
                <p>KAMARAJ COLLEGE OF ENGINEERING & TECHNOLOGY</p>
                <p>S.P.G.Chidambara nadar - C.Nagammal Campus </p>
                <p>S.P.G.C. Nagar, K.Vellakulam-625 701, Near Virudhunagar</p>
            </div>
        </div>
    </div>
  );
}

export default Footer;
